	  <script>
// support css asset retry
(function() {
  document.addEventListener('error', function(event) {
    try {
      if (!event) { return; }

      // get link element and make sure it has href
      var target = event.target || event.srcElement;
      if (!(target instanceof HTMLLinkElement)) { return; }
      if (!target.href) { return; }

      // do not retry assets twice
      if (target.getAttribute('data-retried') === 'yes') { return; }

      // main and backup cdn may be swapped on runtime, so do not assume they will not change
      var cdnHost = window.QCCDN_HOST || 'cloudcache.tencentcs.com';
      var backupCdnHost = window.QCCDN_BACKUP_HOST || 'cloudcache.tencent-cloud.com';

      // do not retry none target resources
      if (target.href.indexOf(cdnHost) === -1) { return }

      var newHref = target.href.replace(cdnHost, backupCdnHost);
      /** @type {HTMLLinkElement} */
      var newLink = target.cloneNode();
      newLink.href = newHref;
      newLink.setAttribute('data-retried', 'yes');
      target.replaceWith(newLink);
    }
    catch (err) {
      // ignore error for retry function
    }
  }, true);

})();
</script>

<script type="text/javascript">

	window.VERSION = "zh";

	(function(win, doc){

		var basePath = '//' + QCCDN_HOST + '/qcloud/app/qcconsole_web/dest/';

		// language begin;
		(function () {

			var key,
				result;
			var map = {
				'en': 'en/',
				'ko': 'ko/',
				'jp': '/jp'
			};
			var cleanUrl = false;

			if (result =/lang(?:uage)?=(\w+)/.exec(window.location.search)) {
				key = result[1];
				cleanUrl = true; // 如果从 url 上带有 language 参数, 则应该清除这个参数

				var cn_en_tag;

				if (key === 'en') {
					cn_en_tag = 1;
				} else if (key === 'zh') {
					cn_en_tag = 0;
				}

				// 当query有language，且==en时，设tag为1；==zh时设0，其他不管，过期时间半年 from ericji
				if (typeof cn_en_tag !== 'undefined') {
					document.cookie = 'cn_en_tag=' + cn_en_tag + '; expires=' + new Date(Date.now() + 6 * 30 * 24 * 60 * 60 * 1000).toUTCString() + ' ;domain=' + document.domain + '; path=/';
				}
			} else if (result =/(?:^|\s)language=(\w+)(?:;|$)/.exec(document.cookie)) {
				key = result[1];
			} else {
				key = 'zh';
			}

			if (map[key]) {
				basePath = '//' + QCCDN_HOST + '/qcloud/app/qcconsole_web/build/' + key + '/';
				VERSION = key;
				max_age = 86400;
				// document.write('<link href="//' + cdnHost + '/open_proj/proj_qcloud_v2/mc_2014/css/international-nav.css?max_age=31536000" rel="stylesheet" />');
			}

			var bodyLangCls = {
				'zh': '',
				'en': 'international',
				'ko': 'qc-lang-ko',
				'jp': 'qc-lang-jp'
			}
			document.body.className = bodyLangCls[key];

			document.cookie = 'language=' + window.VERSION + '; expires=' + new Date(2153717523864).toUTCString() + ' ;domain=' + document.domain + '; path=/';

			if (window.LOGIN_INFO && window.LOGIN_INFO.area === 2) {
				document.cookie = 'intl_language=' + window.VERSION + '; expires=' + new Date(2153717523864).toUTCString() + ' ;domain=' + document.domain + '; path=/';
			}

			if (cleanUrl) {
				location.search = location.search.replace(/&?lang(uage)?=\w+/, '');
			}

		})();

		// language end

		var loader = {
			load: function (url, cb) {
				var urlArr = [];
				if (typeof(url) == 'string') {
					urlArr.push(url);
				} else {
					urlArr = url;
				}
				var len = urlArr.length,
					failUrl = [],
					callback = function (url) {
						return function (error) {
							if (error) {
								failUrl.push(url);
							}
							if (!-- len) {
								cb && cb(failUrl.length ? new Error('资源加载失败：\n' + failUrl.join('\n')) : null);
							}
						}
					};
				for (var i = 0, url; url = urlArr[i]; i++) {
					this._load(url, callback(url));
				}
			},
			_load: function (url, cb) {
				var oldIe = /msie [\w.]+/.test(navigator.userAgent.toLowerCase());
				if (oldIe && VERSION === "zh") {
					this._iframeLoad(url, cb);
				} else {
					this._scriptLoad(url, cb);
				}
			},
			_scriptLoad: function (url, cb, retryTimes) {
				retryTimes = retryTimes || 0;
				var el = doc.createElement('script');
				url = /^(https?:)?\/\//i.test(url) ? url : basePath + url + '?max_age=' + max_age;
				el.setAttribute('type', 'text/javascript');
				el.setAttribute('src', url);
				el.setAttribute('async', true);
				// 只有 imgcache.qq.com 和 cloudcache.tencent-cloud.com 两个域名支持跨域脚本协议
				if (_cosdp.test(url) && retryTimes <= 1) {
					el.setAttribute('crossOrigin', 'anonymous');
				}
				// 第一次重试：保持跨域属性，JS 重试
				// 第二次重试：移除跨域属性，JS 重试
				// 第三次重试：备用域名重试，移除跨域属性，JS 重试
				// 第四次重试：使用 XHR 重试
				el.onerror = function (error) {
					if (retryTimes <= 2) {
						++ retryTimes;
						setTimeout(function () {
							if (retryTimes === 3) {
								try {
									url = url.replace(window.QCCDN_HOST, window.QCCDN_BACKUP_HOST);
								} catch (err) {}
							}
							loader._scriptLoad(url, cb, retryTimes);
						}, 500);
						console.warn('Retrying %d (classic): %s', retryTimes, url);
					} else if (retryTimes === 3) {
						++ retryTimes;
						setTimeout(function () {
							try {
								url = url.replace(window.QCCDN_BACKUP_HOST, window.QCCDN_HOST);
							} catch (err) {}
							retryViaXhr('js', url, function (result) {
								result.retry = retryTimes;
								cb(result.success ? null : result);
							});
						}, 1000);
						console.warn('Retrying %d (xhr): %s', retryTimes, url);
					} else {
						cb({retry: retryTimes});
					} el.onerror = el.onload = el.onreadystatechange = null;
				};
				el.onload = el.onreadystatechange = function () {
					if (!this.readyState || this.readyState === 'loaded' || this.readyState === 'complete') {
						if (storeMode && seajs.modules) {
							var modules = seajs.modules,
								jsStr = '';
							for (var key in modules) {
								jsStr += 'define("' + key + '",' + modules[key] + ');';
							}
							try {
								clearLocal(url);
								localStorage[url] = jsStr;
							} catch (e) {
								console.log(e)
							}

							seajs.modules = {};
						}
						cb(null);
						el.onerror = el.onload = el.onreadystatechange = null;
					}
				};
				doc.getElementsByTagName("head")[0].appendChild(el);
			},
			_iframeLoad: function (url, cb) {
				var iframe = doc.createElement('iframe');
				iframe.style.display = "none";
				iframe.src = 'javascript:void(function(){document.open();' + 'document.domain = "' + doc.domain + '";document.close();}());';
				url = /^(https?:)?\/\//i.test(url) ? url : basePath + url + '?max_age=' + max_age;
				iframe.callback = function (jsStr) {
					if (! jsStr) {
						cb(new Error('js load failed'));
						return;
					}
					try {
						eval(jsStr);
						if (storeMode) {
							try {
								clearLocal(url);
								localStorage[url] = jsStr;
							} catch (e) {}
						}
						cb(null);
					} catch (err) {
						cb(err);
					}
					setTimeout(function () {
						doc.body.removeChild(iframe);
						iframe = null;
					}, 1000)

				};
				var iframeLoad = function () {
					var iframeDoc = iframe.contentDocument || iframe.contentWindow.document;
					var iframeHtm = [
						'<html><head><meta charset="utf-8"></head><body onload="callback()">',
						'<script type="text/javascript">',
						'var jsStr = "", cb = false;',
						'var define = function (id, factory) {',
						'if (typeof(factory) == "function") {',
						'var factoryStr = factory.toString();',
						'jsStr += "define(\'" + id + "\'," + factoryStr + ");"',
						'}',
						'};<\/script>',
						'<script type="text/javascript" src="' + url + '"><\/script>',
						'<script type="text/javascript">',
						'function callback() {',
						'if (jsStr && !cb) {',
						'frameElement.callback(jsStr);',
						'cb = true;',
						'}',
						'};',
						'callback();',
						'<\/script>',
						'</body></html>'
					].join('');
					iframeDoc.open();
					iframeDoc.domain = doc.domain;
					iframeDoc.write(iframeHtm);
					iframeDoc.close();
				};

				if (iframe.attachEvent) {
					var _ifmLoad = function () {
						iframe.detachEvent('onload', _ifmLoad);
						iframeLoad();
					};
					iframe.attachEvent('onload', _ifmLoad);
				} else {
					iframe.onload = function () {
						iframe.onload = null;
						iframeLoad();
					}
				};

				doc.body.appendChild(iframe);
			}
		};

		function clearLocal(url) {
			for (var key in win.localStorage) {
				var urlName = url.substring(0, url.indexOf('.'));
				var stoName = key.substring(0, key.indexOf('.'));

		var coreJs = [
			'vendor.js',
			'platform.js',
			'common.js',
			'deprecated.js'
		];

    
		var coreConfigMap = {
			zh: "https://cloudcache.tencentcs.com/qcloud/app/qcconsole_web/config/config_cvm.954947372209436a27dce9e9902e860e.js?obsolate",
			en: "https://cloudcache.tencentcs.com/qcloud/app/qcconsole_web/config/config_cvm.519c6c1d6e483e6961555d8720309d21.js?obsolate",
			jp: "https://cloudcache.tencentcs.com/qcloud/app/qcconsole_web/config/config_cvm.80a7accbd2421e201f1dc8d6d71f2bc1.js?obsolate",
			ko: "https://cloudcache.tencentcs.com/qcloud/app/qcconsole_web/config/config_cvm.d550feb000443bb11e8c63454c72557b.js?obsolate"

		function isInCoreJs(name) {

		// 初始化的时候设置主题模式，避免后续切换的体验问题
		function initTheme() {
			var themeType = 1; // 默认深色模式

				var ownerUin = window.LOGIN_INFO && window.LOGIN_INFO.ownerUin;
				var loginUin = window.LOGIN_INFO && window.LOGIN_INFO.loginUin;

					var key = 'menu_local_theme_type_' + loginUin + '_' + ownerUin;
					themeType = +localStorage.getItem(key);
				}
			} catch (e) { }

			// 深色主题
			if (!themeType || themeType === 1) {
				document.body.classList.remove('theme-light');
				document.body.classList.add('theme-dark');
			} else {
				document.body.classList.remove('theme-dark');
				document.body.classList.add('theme-light');
			}
		}

			configSeajs();

				performance.mark('platform-asset-req-starttime');
			}

			var needLoadArr = [coreConfig],
				needEvalArr = [];

			for (var name in jsVersion) {
				if (isInCoreJs(name)) {
					var loadName = getTargetName(name);
					if (storeMode) {
						if (localStorage[loadName]) {
							needEvalArr.push(loadName);
						} else {
							needLoadArr.push(loadName);
						}
					} else {
						needLoadArr.push(loadName);
					}
				}
			};

			// var menuSdkConfig = g_buffet_data.sdkRouter['menus-sdk'];

			//     needLoadArr.push(menuSdkConfig.content.replace('imgcache.qq.com', QCCDN_HOST));

				}

				if (storeMode) {
					for (var i = 0, item; item = needEvalArr[i]; i++) {
						try {
							eval(localStorage[item]);
						} catch (e) {

						}

					targetName = name;
				}
			} else if (debug == 2) {
				targetName = name;
			} else {
				targetName = jsVersion[name];
			}
			return targetName;
		}

		function nmcLoad(name, cb) {
			var loadName = getTargetName(name);
			if (nmcLoad.loaded[loadName]) {
				cb && cb();
				return;
			}
			if (storeMode && localStorage[loadName]) {
				eval(localStorage[loadName]);
				nmcLoad.loaded[loadName] = true;
				cb && cb();
			} else {
				seajs.modules = {};
				loader.load(loadName, function (error) {
					nmcLoad.loaded[loadName] = true;
					cb && cb(error);

			debug = 0,
			storeMode = 0;

		} else if (/\/debug_https/.test(locationHref)) {
